import React from 'react'
import './clients.css'
import gsap from 'gsap'
import Observer from 'gsap/Observer'


const Client = (props) => {
    return (
        <div className="client">
            <img onClick={()=>{
                Observer.create({
                    target: ".client img",
                    onClick: ()=> alert("Yo")
                })
            }} src={props.img} alt="" />
        </div>
    )
}

export default Client
